import React, { useState, useEffect } from 'react';

function EventsList() {
    const {users, setUsers} = useState([]);

    useEffect(() => {
        console.log("Well u did something");
        const response = fetch('http://localhost:8080/users');
        const body = response.json();
        this.setUsers(body);
    });

    console.log("1");

    console.log("2");
    console.log(body);
    console.log(response);

    <button onClick={() => setUsers()}>
        Click me
    </button>

    return(
        <div>
        <h1>Hello</h1>
            {users.map(user =>
                <div key={user.UID}>
                {user.UID} ({user.firstName})
                </div>
            )}
        </div>
    )
}
export default EventsList
